import Head from 'next/head';
import Navbar from '../components/Navbar';



const About = () => (
    <div className="abouts">
        <Head>
            <title>
                Bitzprize
            </title>
        </Head>
        <Navbar />
        <h1>About page</h1>
        <p>Application to view page</p>
 
        <style jsx>{`
    .abouts{
        position:relative;
        display:inline-line;
    }
    h1{
        float:left;
        position:absolute;
        top:20px;
        left:130px;

    }
 

`}</style>





    </div>
);





export default About;
